const panel = {
    "properties" : [
        {
            "index": 0,
            "picture": require('./badass.jpg')
        },
        {
            "index": 1,
            "picture": require('./pic6.jpg')
        },
        {
            "index": 2,
            "picture": require('./pic5.jpg')
        },
        {
            "index": 3,
            "picture": require('./pic4.jpg')
        },
        {
            "index": 4,
            "picture": require('./pic3.jpg')
        },
        {
            "index": 5,
            "picture": require('./pic2.jpg')
        },
        {
            "index": 6,
            "picture": require('./pic1.jpg')
        }
    ]
}

export default panel;
